import React from 'react'
import './Order.sass'
import {BrowserRouter as Router, Switch, Route, useHistory, Link, useRouteMatch} from 'react-router-dom'
import {Map} from '../../components'

function Order() {

	const submitForm = (e) => {
		e.preventDefault()
		alert(1)
	}

	return (
		<div className="order">
			<div className="order__container">
				<div className="order__destination" style={{height:'300px'}}>
					<form onSubmit={submitForm}>
						<input type="text" placeholder='Вулиця'/>
						<input type="text" placeholder='Дім'/>
						<input type="text" placeholder='Квартира'/>
						<select name="" id="" placeholder='sad'>
							<option value="" disabled selected>Парадна</option>
							<option value="1">1</option>
							<option value="2">2</option>
							<option value="3">3</option>
							<option value="4">4</option>
							<option value="5">5</option>
							<option value="6">6</option>
						</select>
						<textarea name="" id="" cols="30" rows="10" placeholder='Коментар до адреси'></textarea>
						<div className="">
							<label>
								<input type="radio" class="" name="delivery" checked />
								Вийду до машини
							</label>
							<label>
								<input type="radio" class="" name="delivery" />
								До дверей
							</label>
						</div>
						<button>Знайти на карті</button>
					</form>
					<details class="funclass" open>
  <summary>Section 1</summary>
  <article>
    <h3>Heading</h3>
    <p>Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Vestibulum tortor quam, feugiat vitae, ultricies eget, tempor sit amet, ante. Donec eu libero sit amet quam egestas semper. Aenean ultricies mi vitae est. Mauris placerat eleifend leo.</p>  
  </article>
</details>

<details class="funclass">
  <summary>Section 2</summary>
  <article>
    <h3>Heading</h3>
    <p>Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Vestibulum tortor quam, feugiat vitae, ultricies eget, tempor sit amet, ante. Donec eu libero sit amet quam egestas semper. Aenean ultricies mi vitae est. Mauris placerat eleifend leo.</p>  
  </article>
</details>

<details class="funclass">
  <summary>Section 3</summary>
  <article>
    <h3>Heading</h3>
    <p>Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Vestibulum tortor quam, feugiat vitae, ultricies eget, tempor sit amet, ante. Donec eu libero sit amet quam egestas semper. Aenean ultricies mi vitae est. Mauris placerat eleifend leo.</p>  
  </article>
</details>
					<Map/>

					
				</div>
				
			</div>
		</div>
	)
}

export default Order

















